import React from 'react';
import { Alert } from 'react-bootstrap';
function Card() {
	return (
		<>
			<img src="/assets/city.jpeg" />
			<object data="/assets/card.svg" width="auto" height="450">
				<div className="text-black">abcd</div>
			</object>
		</>
	);
}

export default Card;
